import s from './MyPosts.module.css'
import Post from './Post/Post'

const MyPosts = () => {
    return (
        <div>
            <div className={s.item}>My post</div>
            <div className={s.item}>New post</div>
            <Post />
        </div>
    );
};

export default MyPosts;
